import React from 'react'
import Slider from 'react-slick';

const NewSlider = () => {

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1
      };

  return (
    <>
<Slider {...settings}>
    <div> Slide 1 </div>
    <div> Slide 2 </div>
    <div> Slide 3 </div>
    <div> Slide 4 </div>
</Slider>
    </>
  )
}

export default NewSlider
